import React, { Component } from 'react'

export default class IncomeStatment extends Component {
    render() {
        //Get the passed in prop
        const income_statement = this.props.income_statement; 
        let keys = [];
        
        //Push all keys onto an array
        Object.keys(income_statement).forEach(key =>
            keys.push(key)     
        ); 
        
        //For each key create a display
        const display = keys.map(key => 
            <p key={key}>{key}: {income_statement[key]}</p>
        );

        return (
            <div>
                <h1>Company Income Statement</h1>
                {display}
            </div>
        )
    }
}
